- input: "TEXT\x1CC00155952\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's letter dated August 1, 2008.  The payment for 'Catering for Donor
    Servicing Event' was for a party event and was not for the benefit of any candiate
    for federal office. Payments for 'Event Ticket Purchase,' 'JJ Table Sponsorship,'
    'Ticket Purchase,' 'Tickets to Golf Classic' were not for the benefit of any candidate
    for federal office. An additional MEMO Schedule H4 has been included in this amendment.
    \ The in-kind contributions were for rent and office supplies that were to take
    effect June 1, 2008.  In fact, the transfer to the Non-Federal account was for
    the period through November 2008 and thus, the transfers were done in advance
    of the receipt of the in-kind. No transfers received from any national party committee
    were used for volunteer exempt activities.  All funds received as transfers from
    national party committees are held in accounts different from those in which exempt
    activity disbursements are made. The receipts on Schedule A for Line 17 are for
    Voter File Purchase. The prices paid for voter file purchases are established
    using comparable prices charged by other state party committees throughout the
    country on a per record cost. The exact price paid to the Committee by each entity
    is determined by multiplying the per record cost by the number of records provided
    in the file purchased, or a set price for a statewide voter file, also determined
    by the total number of records included in the file.  This is considered the 'usual
    and normal charge' for the good provided. "
